import { Route, Router } from '@mui/icons-material';
import './App.css';
import NavBar from './NavBar';
import Cart from './Cart'

function App() {
  return (
    <div className="App">
     <NavBar></NavBar>
     <Router>
      <Route path='cart' element={<Cart/>}></Route>
     </Router>
    </div>
  );
}

export default App;
